REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'processor_description_p21', '<b>P21 Simple API</b> muliggjør at du kan ta i mot utbetalinger via sjekk. Det tilbyr bransjens mest omfattende sett av bildeskapelse og klareringsløsninger. Med Check 21, vil du motta dine midler innenfor samme dag som sjekk eller direkte innskudd.<br/><br/>For å aktivere Check 21 alternativet, kan du kontakte oss via e-post på:. <a href=\"mailto:support@payment21.com\">support@payment21.com</a> eller på telefon: 1-888-770-0850 (avgiftsfritt i USA) eller 0041-71-740-1629 (Internasjonalt).<br/><br/><a href=\"http://www.payment21.com\" target=\"_blank\">www.payment21.com</a>');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'processor_description_paypal', '<b>PayPal Website Payments Standard</ b> er en rask og rimelig måte å begynne å akseptere kredittkort og PayPal-betalinger på Internett. Kjøperne betaler på sikre PayPal-sider, men trenger ikke en PayPal-konto for å betale deg.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'processor_description_paypal_express', '<b>PayPal: Påvist å øke salget</ b>. Ifølge Jupiter Research, 23% av Internett-kunder liker å betale med PayPal .* Hvis du tilbyr dine besøkende muligheten til å betale med PayPal, er det mer sannsynlig at de kjøper noe.<br/><br/>* September 2007 Jupiter Research studie av betalingsmetoder online.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'processor_description_paypal_pro', '<b>PayPal Website Payments Pro</b> er en alt-i-ett-løsning som lar deg akseptere kredittkort. Kjøpere kan legge inn sine kredittkortnummer direkte på nettstedet ditt.');
