REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_2checkout_notice', '<b>Merk</b>: For å spore 2Checkout bestillinger med handlevogn programvaren du har, må du gjøre følgende steg:<br /><br />-&nbsp;Logg inn på din 2Checkout konto<br />-&nbsp;Klikk på<u>\'Site management\'</ u> i <u>\'Account\'</ u> seksjonen.<br />-&nbsp;Velg <b>\'Given links back to my website\'</b> alternativet i <u>\'Direct Return\'</u> underseksjonen <br />-&nbsp;Sett <u>\'Approved URL\'</u> og <u>\'Pending URL\'</u> til:<br /><b>[return_url]</b><br />-&nbsp;Sett <u>\'Secret Word\'</u>. Det hemmelige ordet er kun kjent for selger og 2CheckOut.<br />');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_365_notice', 'Vennligst bruk følgende URL som PostbackURL, og send den til 365 Faktureringsstøtten til å settes som Vellykket og Mislykket omdirigerings URL\'er: <br /><b>[return_url]</b>');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_access_email_notice', 'Her kan du enten forby en bestemt e-postadresse eller alle adressene for domenet (f.eks test.com).');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_access_notice', 'Du kan bruke jokertegn for \"Domene\", \"E-post\" og \"Kredittkort\" faner: <br /><b>*</b> - kan representere hvilket som helt antall tegn, inkludert null<br /><b>?</b> - kan representere et hvilkens som helst enkelt tegn.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_access_reverse_ip', 'Vær oppmerksom på at alternativet \"Logg inn til admin panel kun fra spesifiserte IP-adresser\" er <b>AKTIVERT</b> , så kun de definerte IP\'ene har lov til å logge inn til admin panelet. <a href=\"[link]\"><b>deaktiver &#155;&#155;</b></a>');
