REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_affiliate_welcome', '<b>Velkommen til Affiliate-området </b><br /><br />Vi har gleden av å tilby deg muligheten til å bli vår affiliate.<br /><br />Tjen penger med oss, det er lett!<br /><br />Føl deg fri til å registrere deg som affiliate bruke \"Registrer\" knappen i \"Autentisering\"-boksen nedenfor. Hvis du allerede har registrert, vennligst logge deg på der.<br />');
