REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_amazon_callback_url', 'Viktig! Du må angi butikkens URL <b>[callback_url]</ b> som \"Merchant URL\" på Amazon\'s Seller Central hjemmeside (Settings > Checkout Pipeline Settings). Ellers, vil du ikke kunne godta betalinger via Amazon Checkout i butikken din');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_amazon_failed_order', 'Ingen respons fra Amazon Checkout er mottatt ennå, vennligst vent. Selv om ordren kanskje ikke opprettes i butikken på en stund, er det overveiende sannsynlig at den har blitt opprettet og behandlet av Amazon Checkout. Vennligst kontakt butikkens personale og fortell dem ordre ID som gitt av Amazon');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_amazon_incorrect_products_count', 'Antall produkter i handlevognen din avviker fra antall produkter i forespørselen til Amazon.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_amazon_link_message', 'For testformål kan \"Merchant URL\" være HTTP link til butikken din, men live-modus krever sikker tilkobling, og du må bruke HTTPS-linken. Husk også å aktivere produksjonsmodus på Amazon\'s Seller Central hjemmesiden når du er klar til å gå live.');
