REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_assist_notice', '<p>For at \"Assist\" betalingsmåte skal være vellykket bør du aktivere \"Return to store by returning URL\" alternativet på https://secure.assist.ru/members/ i \"Design pages\" seksjonen på betalingssiden.</p>');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_atos_notice', '<b>Merk:</b><br /> 1. Kopier sertifikatet som du mottok på disken til [home_path] katalogen. Omdøp navnet på sertifikatet til certif.fr.[my_merchant_id], der [my_merchant_id] er ditt nettsidenummer.<br /> 2. Omdøp navnet til butikkens parameterfil (parmcom.014213245611111 file) til parmcom.[my_merchant_id].<br />3. Editer <b>pathfile</b> filen i <b>[home_path]</b> katalogen<br />- Erstatt tekststrengen \'<u>D_LOGO![some_dir]!</u>\' med \'<u>D_LOGO![http_path]/logo/!</u>\'<br />- Erstatt tekststrengen \'<u>F_DEFAULT![/some_dirs/parmcom.sogenactif]!</u>\' med \'<u>F_DEFAULT![home_path]/parmcom.sogenactif!</u>\'<br />- Erstatt tekststrengen \'<u>F_PARAM![/some_dirs/parmcom]!</u>\' med \'<u>F_PARAM![home_path]/parmcom!</u>\'<br />- Erstatt tekststrengen \'<u>F_CERTIFICATE![/some_dirs/certif]!</u>\' med \'<u>F_CERTIFICATE![home_path]/certif!</u>\'<br />4. Editer <b>parmcom.[some_number]</b> filen i <b>[home_path]</b> katalogen<br />- Erstatt tekststrengen \'<u>AUTO_RESPONSE_URL![some_url]!</u>\' med \'<u>AUTO_RESPONSE_URL![auto_url]!</u>\'<br />- Erstatt tekststrengen \'<u>CANCEL_URL![some_url]!</u>\' med \'<u>CANCEL_URL![ok_url]!</u>\'<br />- Erstatt tekststrengen \'<u>RETURN_URL![some_url]!</u>\' med \'<u>RETURN_URL![ok_url]!</u>\'<br />');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_atos_warning', '<span style=\"color:#FF2222\">Advarsel !!!</span>Stien til ATOS-filer bør bestå av ikke mer enn 60 tegn, ellers vennligst kopier atos_files mappen til en overordnet katalog, f.eks til butikkens \"core\" katalog. I tillegg, sørge for at ATOS filkatalogen har fulle tillatelser.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_authentication_failed_message', 'Din finansinstitusjon har indikert at de ikke kunne godkjenne denne transaksjonen. For å beskytte mot uautorisert bruk, kan ikke dette kortet brukes til å fullføre kjøpet. Du kan fullføre kjøpet ved å velge en annen form for betaling.');
