REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_exim_import_features_note', '<b>Produkfunksjoner import format</b><code>{$ldelim}%Funksjons ID%{$rdelim} (%Gruppenavn%) %Funksjonsnavn%: %Funksjonstype%[%Funksjonsverdi%]</code>der,<p>%Funksjons ID% - ID\'en til funksjonen,<br />%Gruppenavn% - navnet på funksjonesgruppen,<br />%Funksjonsnavn% - navnet på funksjonen,<br />%Funksjonstype% - type funksjon (C - avkrysningsrute, M - flere avkrysningsruter, S - tekst valgboks, N - nummer valgboks, E - utvidet valgboks, T - enkel tekst, O - nummer, D - dato),<br />%Funksjonsverdi% - funksjonsverdien (flere verdier kan bli avgrenset av komma)</p><p>Flere funksjoner må skilles med semikolon.</p><b>Eksempel:</b><br /><code>ISBN: T[1233423423]; Utgivelsesdato: D[05/05/07]; Farge: S[Rød]        </code>');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_exim_import_files_note', '<b> File import format </ b> <code>% Filplassering% </ code> der, <p>% Filplassering% - kan være en absolutt eller relativ sti i en server filsystem eller en nettadresse <br /> Flere filer må være avgrenset av komma </ p> <b> Eksempel 1:. </ b> <br /> <code> file1.jpg </ code> <b> Eksempel 2: </ b> <br /> <code> backup/file1.zip, images/file2.jpg </ code>');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_exim_import_images_note', '<b> Image import format </ b> <code>% Bildeplassering% #% Alternativ tekst% </ code> der, <p>% Bildeplassering% - kan være en absolutt eller relativ sti i en server filsystem eller en URL, <br />% Alternativ tekst% - image alternativ tekst </ p> <b> Eksempel 1: </ b> <br /> <code> bilder / product_images / apples.jpg # epler </ code> <b > Eksempel 2: </ b> <br /> <code> http://www.site.com/apples.jpg # epler </ code>');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_exim_import_notice', 'Nedenfor er en liste over de feltene som i datafilen kan inneholde. Feltene merket med <b> fet </ b> er obligatorisk. Hvis du importerer data med spesielle symboler (komma, semikolon, osv.), må du kontrollere at du har disse feltene sitert.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_exim_import_options_note', '<b> Produkt alternativer import format </ b> <code> {$ ldelim}% Option ID [_L]% {$ rdelim}% Alternativ name%:% Opsjonstype% [{$ ldelim}% Variant 1 ID% {$ rdelim}% Variant 1%, {$ ldelim}% Variant 2 ID% {$ rdelim}% Variant 2%, {$ ldelim}% Variant N ID% {$ rdelim}% Variant N%] </ code> der, < p>% Option ID% - id av opsjonen, <br /> L </ b> - betyr valgfritt parameter, at det er en koblet global mulighet til produktet <br />%. Navnet på alternativet% - navnet på alternativet, <br />% Opsjonstype% - alternativet type, kan være følgende: <br /> S </ b> - Valgboksen, <br / > <b> R </ b> - radiogroup, <br /> C </ b> - boksen, <br /> I </ b > - enkel inngang, <br /> T </ b> -. textarea <br /> </ p>% Variant N ID% - id av varianten, <br / >% Variant N% - navnet på varianten. Varianter må angis hvis alternativet typen er en Valgboksen eller radiogroup bare </ p> Flere alternativer må skilles med semikolon </ p> <b> Eksempler:.. </ B> <br /> <p> Enkel tekst alternativer: <code> Din alder: I; Fødselsdato: I; Merknader: T </ code> </ p> Valg med varianter: <code> Farge: S [Red, Green, Blue]; Størrelse: R [X, XL, XXL] </ code> </ p>');
