REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_mb_quick_checkout_payments', 'Kundene kan bare fullføre en transaksjon med Moneybookers Payment Gateway hvis de betaler via en av følgende metoder: Visa, MasterCard, Amex, JCB, Diners, Laser, Solo (UK), Maestro (UK), Carte Bleue, tysk Direct Debit, Giropay, Sofortueberweisung.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_mcpe_notice', 'Som standard, er minimums-og maksimumsverdier for de enkelte transaksjonene på kontoen din som vist nedenfor: <table cellpadding=\"3\"> <tr> <td> <b> Grenser </ b> </ td> <td> GBP < / td> <td> USD </ td> <td> EUR </ td> <tr> <td> <b> Minimum </ b> </ td> <td> £ 1 </ td> <td> $ 1 </ td> <td> € 1 </ td> </ tr> <tr> <td> <b> Maksimum </ b> </ td> <td> £ 1000 </ td> <td> $ 1500 </ td> <td> € 1500 </ td> </ tr> <table> Ta kontakt med din kontofører for å be om høyere grenser på kontoen din. <br /> <p> Vennligst angi følgende parametere i Merchant ekstranett. Klikk Account Management og Installasjoner: <br /> - Response URL: [return_url] <br /> - Tilbake URL: [return_url] </ p>');
