REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_moneybookers_activate_quick_checkout_short_explanation', 'Moneybookers Merchant Tools gjør det mulig å ta betaling fra kredittkort, debetkort og over 60 andre lokale betalingsmåter i over 200 land. Den svært konkurransedyktige priser for denne tjenesten er publisert på Moneybookers nettsted www.moneybookers.com.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_moneybookers_activate_quick_checkout_short_explanation_1', 'Du har sendt en forespørsel om aktivisering på [dato]. Vær oppmerksom på at bekreftelsesprosessen til å bruke Moneybookers Merchant Tools kunne ta opptil 72 timer. Du vil bli kontaktet av Moneybookers når verifiseringen prosessen er fullført.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_moneybookers_activate_quick_checkout_short_explanation_2', 'Etter aktivering Moneybookers vil gi deg tilgang til en ny seksjon på din Moneybookers-konto kalt Merchant Tools. Det kan du velge et hemmelig ord (IKKE det samme som passord) og angi det i avsnittet under for å koble til Moneybookers. Det hemmelige ordet er siste trinn i aktiveringsprosessen, og krypterer dine betalinger sikkert. Etter vellykket innlevering vil du være klar til å bruke alle direkte betaling valg av Moneybookers.');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_moneybookers_currs_notice', 'Hvis du har valgt en valuta som ikke er basen en i butikken din, må du sørge for at den har riktig <a href=\"http://en.wikipedia.org/wiki/ISO_4217\"> ISO 4217-koden </ a> på <a href=\"[link]\"> valutaene </ a> siden.');
