REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_more_info_cvv', '<h1 class=\"subheader\"> Mer informasjon:? </ h1> <p> Hva er CVV Number </ strong> </ p> KORT VERIFISERING VALUE CODE (CVV) </ p> < p> CVV er en ny godkjenningsprosedyren opprettet av kredittkortselskaper til videre innsats for å redusere svindel for internett transaksjoner. Den består av krever et kort kunne gå inn som CVV nummer i på transaksjon tid for å kontrollere at kortet er på hand.The CVV-koden er en sikkerhetsfunksjon for \"kort ikke tilstede\" transaksjoner (for eksempel Internet transaksjoner), og nå vises på de fleste (men ikke alle) de store kreditt-og debetkort. Denne nye funksjonen er en tre-eller firesifret kode som gir en krypteringskontroll av informasjonen lagret på kortet. Derfor er CVV-koden ikke er en del av kortet nummeret selv. </ P> CVV koden hjelper konstatere at kunden bestilling faktisk besitter kreditt / debetkort, og at kortet kontoen er legitim. Hver kredittkortselskap har sitt eget navn for CVV-koden, men det fungerer likt for alle større korttyper. (VISA viser til koden som CVV2, kaller MasterCard det CVC2, og American Express kaller det CID.) </ P> Baksiden panel av de fleste Visa / MasterCard-kort inneholder hele 16-sifret kontonummer, etterfulgt av CVV / CVC-kode. Noen banker, men bare vise de siste fire sifrene i kontonummeret etterfulgt av koden. <strong> Til hjelp i forebygging av uredelige kredittkort bruk, krever vi nå at 3 eller 4-sifret kode på baksiden av kredittkortet ditt. </ strong> Når du sender inn kredittkortinformasjonen din data er beskyttet av Secure Socket Layer (SSL)-teknologi sertifisert av et digitalt sertifikat. </ p>');
