REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_paybox_notice', '<b> Merk: </ b> Last ned filen modulev2.cgi fra PayBox serveren, kopiere den til <b> [cart_dir] / utbetalinger / paybox_files / </ b> katalogen <u> i binær modus </ u > og gjøre den kjørbar. <br /> Kjør følgende kommando: <br /> <i> chmod 755 modulev2.cgi </ b> </ i> <br /> <br /> Også spør \"Paybox\" service å legge til følgende URL til databasen som \"Tilbakering URL\": <br /> <b> [callback_url] </ b>');
REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_payflow_notice', '<b> Merk: </ b> Før PayFlow Pro betalingsmodul begynner å jobbe, må du kontrollere at alle nødvendige ekstra komponenter er installert. Du finner dem på \"Downloads\"-siden <a href=\"https://manager.verisign.com/\" target=_blank> <b> Merchant Backoffice </ b> </ a>. <br /> < br /> Fra \'Downloads-siden, kan du laste ned \"Payflow Pro Software Development Kit (SDK) som er i samsvar med operativsystemet. Pakk ut den nedlastede filen arkivet. Deretter kopierer filene: <ul> <li> For Windows NT og Windows 2000: <br /> Kopier filene <u> bin / pfpro.exe </ u> og <u> lib / pfpro.dll </ u > til katalogen <u> [cart_dir] / utbetalinger / payflow_files / bin </ u> <br /> Kopier innholdet av konserter katalogen til katalogen <u> [cart_dir] / utbetalinger / sertifikater </ u> <li > For Unix: <br /> Kopier filen <u> bin / pfpro </ u> til katalogen <u> [cart_dir] / utbetalinger / payflow_files / bin </ u> <br /> Kopier filen <u> lib / libpfpro.so </ u> til katalogen <u> [cart_dir] / utbetalinger / payflow_files / lib </ u> <br /> Kopiere innholdet av konserter katalogen til katalogen <u> [cart_dir] / betalinger / sertifikater </ u> </ ul>');
