REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_qbms_notice', '<p> Du bør bruke \"test\"-modus hvis du har en PTC-konto. </ P> Under registreringen av søknaden angi følgende verdier: <br /> - Type: hosted (web-basert app) <br /> - Abonner URL: [response_url] <br /> - Endre URL: [response_url] <br /> - Avbryt URL: [response_url] <br /> </ p> <b> Connection billett </ b> vil bli fylt ut automatisk etter at du oppretter tilkoblingen her: http:// merchantaccount.ptc.quickbooks.com / j / sdkconnection / connectionList? AppID = [My_App_ID] (vennligst erstatte [My_App_ID] med AppID nummer) og klikk på \"Bruk denne forbindelsen\" knappen. </ p> For å få \"Signed sertifikat\" kan du se <b> http://developer.intuit.com/QuickBooksSDK/chart.asp?id=496 </ b> <br /> Når du har opprettet sertifikater (Intuit CA & Client Signert ) må du gjøre følgende: <br /> en. trekke ut nøkkelen fra CSR du opprettet (disse trinnene gjelder bare hvis keytool ble brukt) <br /> - Last ned Java klassen å eksportere Privat nøkkel fra sertifikat: http://mark.foster.cc/pub/ java / ExportPriv.java <br /> - Kompiler denne klassen: \"javac ExportPriv.java\" <br /> - Eksport nøkkelen til filen: \"java ExportPriv <keystore> <alias> <passord>> eksporteres -pkcs8.key \"<br /> to. Lagre klienten signerte sertifikatet til filen (f.eks qbms_cert.txt) <br /> tre. Lagre til den samme filen på tasten ble hentet på trinn 1. <br /> Fire. Kopier resulterte filen til [lagre] / utbetalinger / sertifikater og sett verdien av <b> \"Certificate filename\" </ b> til filnavnet. <br /> </ P>');
