REPLACE INTO cscart_language_values (`lang_code`, `name`, `value`) VALUES ('NO', 'text_thaiepay_notice', '<p> Vennligst angi følgende verdier i Thaiepay kjøpmann innstillingene: </ p> Tilbake Url: <b> [return_url] </ b> </ p> Status: <b> Ja (det er viktig) </ b> </ p> Post Tilbake Url:! <b> [postback_url] </ b> </ p> Main Parameter: <b> \"total\" skal kontrolleres </ b > - det vil øke sikkerheten for transaksjoner </ p> Flere Parameter: Det er obligatorisk for vellykket behandling av transaksjoner. For eksempel kan du sette <b> name = fullført </ b> og <b> verdi = some_secret_word </ b>. Kopier disse verdiene til disse feltene: \"Flere parameter Name\" og \"Flere parameter Value\" </ p>.');
